import styled from "styled-components";

export const StyledHomeContainerTwo = styled.div`
  display: flex;
  height: 100vh;
  padding-left: 50px;
  align-items: center;
  button {
    margin-left: 10%;
  }
`;

export const StyledCanvas = styled.div`
  width: 30%;
`;

export const StyledLineOne = styled.h1`
  color: white;
  font-size: 48px;
  width: 70%;
  margin-left: 10%;
`;

export const StyledLineTwo = styled.p`
  color: #d766f5;
  font-size: 24px;
  margin-left: 10%;
  span {
    color: white;
  }
`;
